#include <iostream>
#include <string.h>
#include <string>
#include <algorithm>

using namespace std;

class Solution {
public:
    bool validPalindrome(string s) {
    bool isPalindrome = true;
      
    int j = s.size()-1;
    int i =0;
    int letterRemoved = 0;
    
    while (i<j )
    {
        cout<< "s["<<i<<"]: " << s[i] << " s[" << j <<"]" << s[j]<<endl;
        if(tolower(s[i]) !=tolower(s[j]) )
        {
             int isLeftEqual;
            int isRightEqual;
            //Part 1
            cout<< "Print Right substring: "<< s.substr(i+1, j-i)<< endl;
            string newRightString = s.substr(i+1, j-i);
            reverse(newRightString.begin(),newRightString.end());
             isRightEqual = newRightString.compare(s.substr(i+1, j-i));
            cout<< "isRightEqual: "<< isRightEqual<< endl;
             //Part 2
            if(isRightEqual != 0)
            {
        
            cout<< "Print Left substring: "<< s.substr(i, j-i)<< endl;
            string newLeftString = s.substr(i, j-i);
            reverse(newLeftString.begin(),newLeftString.end());
            isLeftEqual = newLeftString.compare(s.substr(i, j-i));

            }
            if(isRightEqual == 0 || isLeftEqual == 0)
            {
                isPalindrome = true;
                return isPalindrome;
            }
            else
            {
                isPalindrome = false;
                return isPalindrome;
            }

        }
        else{
            i++;
            j--;
        }
       
    }
   
    return isPalindrome;

    }
};

